import React from "react";
import { Link } from "react-router-dom";
import Jumbotron from "../../components/Jumbotron";

const Home = () => (
  <>
    <Jumbotron />
    <Link to="/profile" exact activeClassName="router-link-exact-active">
      Dashboard
    </Link>
    <hr />
  </>
);

export default Home;
